import React from 'react';
import ReactDOM from 'react-dom/client';
import { App } from 'components/App';
import './index.css';
import user from "/user.json";
ReactDOM.createRoot(document.getElementById('root')).render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);



function Profile(props) {
  return (
    <div class="profile">
      <div class="description">
        <img
          src={user.avatar}
          alt={user.username}
          class="avatar"
        />
        <p class="name">{user.username}</p>
        <p class="tag">{user.tag}</p>
        <p class="location">{user.location}</p>
      </div>

      <ul class={user.stats}>
        <li>
          <span class="label">{user.stats.followers}</span>
          <span class="quantity">5603</span>
        </li>
        <li>
          <span class="label">{user.stats.views}</span>
          <span class="quantity">4827</span>
        </li>
        <li>
          <span class="label">{user.stats.likes}</span>
          <span class="quantity">1308</span>
        </li>
      </ul>
    </div>
  );
}
ReactDOM.render(
  <Profile
    username={props.username}
    tag={props.tag}
    location={props.location}
    avatar={props.avatar}
    stats={props.stats}
  />,
  document.querySelector('#root'));


